sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
 try{
    var obvUtil = new OracleBootVolumeUtils();
    obvUtil.validateInputVariables(inputs, outputs);
    obvUtil.validateMandatoryVariables(inputs,["bootVolumeId","instanceId"]);
    var payload = obvUtil.createPayload(inputs,["displayName","bootVolumeId","instanceId"]);
    outputs.payload = JSON.stringify(payload);

  }
  catch(ex){

    throw new Error("Mandatory Fields Should be provided");

  }
})(inputs, outputs);

